import Pusher from 'pusher-js';
import myStore from './index.js';

const user = myStore.getState().userId;
console.log(user);
const pusher = new Pusher('f790521ed52ae6aaf77e', {
    cluster: 'eu',
    forceTLS: true,
    authEndpoint: 'http://localHost:8080/pusher/auth',
    auth: {
      user: user
    }
  });

  export default pusher;
